import React, { Fragment, useEffect } from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import { REACT_APP_BASE_URL } from './Config/Config';
import 'react-toastify/dist/ReactToastify.css';
import './App.css';
import { useSelector, useDispatch } from 'react-redux';
import { AdminGetProfileAction } from './Redux/Actions/AuthActions';

// Routes
import PrivateRoutes from './Router/PrivateRoutes';

// Components
// Auth Component
import Login from './Components/Auth/Login';
import ForgotPassword from './Components/Auth/ForgotPassword';
import RestPassword from './Components/Auth/RestPassword';

import Profile from './Components/Auth/Profile';
import ChangePassword from './Components/Auth/ChangePassword';

// Dashboard Component
import Dashboard from './Components/Dashboard/Index';

// Banner Component
import Banner from './Components/Banner/Banner';
import AddBannerForm from './Components/Banner/AddBannerForm';
import EditBannerForm from './Components/Banner/EditBannerForm';

// Category Component
import Category from './Components/Category/Category';
import AddCategoryForm from './Components/Category/AddCategoryForm';
import EditCategoryForm from './Components/Category/EditCategoryForm';

// Product Component
import Product from './Components/Product/Product';
import AddProductForm from './Components/Product/AddProductForm';
import EditProductForm from './Components/Product/EditProductForm';

// Buyer Component
import Buyer from './Components/User/Buyer/Buyer';
import AddBuyerForm from './Components/User/Buyer/AddBuyerForm';
import EditBuyerForm from './Components/User/Buyer/EditBuyerForm';
import ViewBuyer from './Components/User/Buyer/ViewBuyer';

// Distributor Component
import Distributor from './Components/User/Distributor/Distributor';
import AddDistributorForm from './Components/User/Distributor/AddDistributorForm';
import EditDistributorForm from './Components/User/Distributor/EditDistributorForm';
import ViewDistributor from './Components/User/Distributor/ViewDistributor';

// Newsletter Component
import Newsletter from './Components/Newsletter/Newsletter';

// Manufacturer Component
import Manufacturer from './Components/Manufacturer/Manufacturer';
import AddManufacturerForm from './Components/Manufacturer/AddManufacturerForm';
import EditManufacturerForm from './Components/Manufacturer/EditManufacturerForm';

// Not Found Component
import PageNotFound from './Components/Error/PageNotFound';

function App() {
  const { status_get_profile } = useSelector((state: any) => state.AdminGetProfileState);
  const dispatch = useDispatch<any>();
  useEffect(() => {
    const isAdminLoginToken = localStorage.getItem('isAdminLoginToken');
    if (isAdminLoginToken) {
      if (status_get_profile === false) {
        // if (window.performance) {
        // if (performance.navigation.type == 1) {
        dispatch(AdminGetProfileAction({}));
        // }
        // }
      }
    }
  }, [status_get_profile]);
  return (
    <Fragment>
      <Router>
        <Routes>
          <Route element={<PrivateRoutes />} >
            {/* Dashboard Route */}
            <Route path={REACT_APP_BASE_URL} element={<Dashboard />} />

            {/* Auth Route */}
            <Route path={REACT_APP_BASE_URL + "profile"} element={<Profile />} />
            <Route path={REACT_APP_BASE_URL + "change-password"} element={<ChangePassword />} />

            {/* Banner Route */}
            <Route path={REACT_APP_BASE_URL + "banner"} element={<Banner />} />
            <Route path={REACT_APP_BASE_URL + "banner-create"} element={<AddBannerForm />} />
            <Route path={REACT_APP_BASE_URL + "banner-edit/:id"} element={<EditBannerForm />} />

            {/* Category Route */}
            <Route path={REACT_APP_BASE_URL + "category"} element={<Category />} />
            <Route path={REACT_APP_BASE_URL + "category-create"} element={<AddCategoryForm />} />
            <Route path={REACT_APP_BASE_URL + "category-edit/:id"} element={<EditCategoryForm />} />

            {/* Product Route */}
            <Route path={REACT_APP_BASE_URL + "product"} element={<Product />} />
            <Route path={REACT_APP_BASE_URL + "product-create"} element={<AddProductForm />} />
            <Route path={REACT_APP_BASE_URL + "product-edit/:id"} element={<EditProductForm />} />

            {/* Buyer Route */}
            <Route path={REACT_APP_BASE_URL + "buyer"} element={<Buyer />} />
            <Route path={REACT_APP_BASE_URL + "buyer-create"} element={<AddBuyerForm />} />
            {/* <Route path={REACT_APP_BASE_URL + "buyer-edit/:id"} element={<EditBuyerForm />} /> */}
            <Route path={REACT_APP_BASE_URL + "buyer-view/:id"} element={<ViewBuyer />} />

            {/* Distributor Route */}
            <Route path={REACT_APP_BASE_URL + "distributor"} element={<Distributor />} />
            <Route path={REACT_APP_BASE_URL + "distributor-create"} element={<AddDistributorForm />} />
            {/* <Route path={REACT_APP_BASE_URL + "distributor-edit/:id"} element={<EditDistributorForm />} /> */}
            <Route path={REACT_APP_BASE_URL + "distributor-view/:id"} element={<ViewDistributor />} />

            {/* Newsletter Route */}
            <Route path={REACT_APP_BASE_URL + "newsletter"} element={<Newsletter />} />    

            {/* Manufacturer Route */}
            <Route path={REACT_APP_BASE_URL + "manufacturer"} element={<Manufacturer />} />
            <Route path={REACT_APP_BASE_URL + "manufacturer-create"} element={<AddManufacturerForm />} />
            <Route path={REACT_APP_BASE_URL + "manufacturer-edit/:id"} element={<EditManufacturerForm />} />        
          </Route>

          {/* Auth Route */}
          <Route path={REACT_APP_BASE_URL + "login"} element={<Login />} />
          <Route path={REACT_APP_BASE_URL + "forgot-password"} element={<ForgotPassword />} />
          <Route path={REACT_APP_BASE_URL + "reset-password"} element={<RestPassword />} />

          {/* Not Found Route */}
          <Route path={REACT_APP_BASE_URL + "*"} element={<PageNotFound />} />
        </Routes>
      </Router>
    </Fragment>
  );
}
export default App;
